import { NgModule } from '@angular/core';
import { Routes, RouterModule } from '@angular/router';

import { MpacientesPage } from './mpacientes.page';

const routes: Routes = [
  {
    path: '',
    component: MpacientesPage
  }
];

@NgModule({
  imports: [RouterModule.forChild(routes)],
  exports: [RouterModule],
})
export class MpacientesPageRoutingModule {}
